import React from 'react';


const SinglePost = (props) => {
    const { post } = props;
    return (
        <div className="single-post">
            <div>
                {post.title}
            </div>
            <div>
                {post.description}
            </div>
            <div>
                {post.price}
            </div>
        </div>
    )
}

export default SinglePost;
